import axios from 'axios';
import React, { useEffect, useState } from 'react'

const Api = () => {
    const [data,setData] = useState([]);
    useEffect(() =>{
        try{
            axios.get("https://dummyjson.com/users").then((response)=>{
                console.log(response);
                
            })
        }
        catch(error){
            console.log(error);
            
        }
    },[])
  return (
    <>
    <table>
        <thead>
            <th>Id</th>
            <th>First Name</th>
        </thead>
    </table>
    </>
  )
}

export default Api
